import React, { createContext, useState } from 'react'

export const SendemailContexte = createContext();

const SendemailProvider = ({children}) => {
    const [object, setObject] = useState("Nouveau Message")
    const [name, setName] = useState("Younes")
    const [email, setEmail] = useState("forzabvb98@gmail.com")
    const [message, setMessage] = useState("Hello from my React application!e")
    return (
        <SendemailContexte.Provider value={
            {
                object,
                setObject,
                name,
                setName, 
                email,
                setEmail,
                message,
                setMessage,
            }
        }>
            {children}
        </SendemailContexte.Provider>
    )
}

export default SendemailProvider
